import fs from "fs"
import { path, join } from "path"

export default () => {
  let filePath = "./public/admin/collections/Categories"
  let fileNames = fs.readdirSync(filePath)
  return fileNames.map(x => {
    return {
      params: {
        id: fileName.replace(/\.json$/, '')
      }
    }
  })
}
